		<style>
		     body {
             background-color: #fbc02d;
             }
		     @import url("https://fonts.googleapis.com/css?family=Roboto:200,400,700");
		     *, *:before, *:after {
		       box-sizing: border-box;
		       -webkit-font-smoothing: antialiased;
		       -moz-osx-font-smoothing: grayscale;
		     }

		     html,
		     body {
		       font-family: "Roboto", Arial, sans-serif;
		       width: 100%;
		       height: 100%;
		       margin: 0;
		       padding: 0;
		     }

		     body {
		       display: -webkit-box;
		       display: -ms-flexbox;
		       display: flex;
		       -webkit-box-align: center;
		          -ms-flex-align: center;
		             align-items: center;
		        -webkit-box-pack: center;
		           -ms-flex-pack: center;
		         justify-content: center;
		     }

		     .card {
		       position: relative;
		       margin: 1rem;
		       padding: 0;
		       width: 295px;
		       min-width: 290px;
		       background: #ffffff;
		       border-radius: 10px;
		       box-shadow: 0px 0px 100px 0px rgba(0, 0, 0, 0.3);
		       -webkit-animation: fadein 5s;
		               animation: fadein 5s;
		       z-index: 999;
		     }

		     .header {
		       position: relative;
		       width: 100%;
		       height: 200px;
		       border-bottom: 2px solid #F1C40F;
		       border-radius: 10px 10px 0 0;
		       overflow: hidden;
		     }

		     .image {
		       width: 100%;
		       height: 200px;
		       border-radius: 4px 4px 0 0;
		       -webkit-transition: all 2s ease;
		       transition: all 0.5s ease;
		     }

		     .image:hover {
		       -webkit-transform: scale(1.09, 1.09);
		               transform: scale(1.09, 1.09);
		     }

		     .icon {
		       display: -webkit-box;
		       display: -ms-flexbox;
		       display: flex;
		       -webkit-box-align: center;
		           -ms-flex-align: center;
		               align-items: center;
		       -webkit-box-pack: center;
		           -ms-flex-pack: center;
		               justify-content: center;
		       position: absolute;
		       right: 24px;
		       top: -40px;
		       width: 80px;
		       height: 80px;
		       border: 0;
		       border-radius: 50%;
		     }

		     .icon > i {
		       color: #ffffff;
		       font-size: 4rem;
		     }

		     .main {
		       display: block;
		       position: relative;
		       padding: 24px 24px 8px 24px;
		       border-top: 2px solid #F1C40F;
		       border-bottom: 1px solid rgba(0, 0, 0, 0.1);
		     }

		     .main > h3 {
		       opacity: 0.7;
		     }

		     .main > p {
		       opacity: 0.5;
		     }

		     .main > hr {
		       border: none;
		       width: 50%;
		       height: 1px;
		       margin: 24px 0;
		       background: #000000;
		     }

		     .moreinfo {
		       display: none;
		     }

		     .footer {
		       padding: 1.5rem 1.5rem 1.5rem 1rem;
		       width: 100%;
		       color: #000000;
		     }

		     /* Fade In animation */
		     @-webkit-keyframes fadein {
		       from {
		         opacity: 0;
		       }
		       to {
		         opacity: 1;
		       }
		     }
		     @keyframes fadein {
		       from {
		         opacity: 0;
		       }
		       to {
		         opacity: 1;
		       }
		     }
		     .backdrop{
		        background-color: #F1C40F;
		      }
		</style>
